import "./app.css";
import React, { useEffect, useState } from "react";

function App() {
  const [count, setCount] = useState(0);

  const handleEvent = () => {
    setCount(count + 1);
  };
  return (
    <>
      <h1>{count}</h1>
      <button onClick={handleEvent}>button</button>
    </>
  );
}

export default App;
